#
# Structure for table "megared_adsl"
#

DROP TABLE IF EXISTS `megared_adsl`;
CREATE TABLE `megared_adsl` (
  `ID` int(11) NOT NULL,
  `CLAVE` varchar(12) COLLATE latin1_spanish_ci DEFAULT NULL,
  `ESCUELA` varchar(255) COLLATE latin1_spanish_ci DEFAULT NULL,
  `DOMICILIO` varchar(255) COLLATE latin1_spanish_ci DEFAULT NULL,
  `CONTRATO` int(11) NOT NULL,
  `MUNICIPIO` varchar(25) COLLATE latin1_spanish_ci DEFAULT NULL,
  `ROUTER` varchar(25) COLLATE latin1_spanish_ci DEFAULT NULL,
  `PROVEEDOR` varchar(12) COLLATE latin1_spanish_ci DEFAULT NULL,
  `PAGADO_POR` varchar(5) COLLATE latin1_spanish_ci DEFAULT NULL,
  `TIPO_CONECT` varchar(5) COLLATE latin1_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `CONTRATO_index` (`CONTRATO`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;

